import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import WelcomePage from './pages/WelcomePage';
import FocusMode from './pages/FocusMode';
import Analytics from './pages/Analytics';
import Settings from './pages/Settings';

function App() {
  return (
    <Router>
      <nav className="flex gap-6 justify-center p-4 bg-gray-100 shadow">
        <Link to="/" className="text-blue-600 hover:underline">Home</Link>
        <Link to="/focus" className="text-blue-600 hover:underline">Focus Mode</Link>
        <Link to="/analytics" className="text-blue-600 hover:underline">Analytics</Link>
        <Link to="/settings" className="text-blue-600 hover:underline">Settings</Link>
      </nav>

      <Routes>
        <Route path="/" element={<WelcomePage />} />
        <Route path="/focus" element={<FocusMode />} />
        <Route path="/analytics" element={<Analytics />} />
        <Route path="/settings" element={<Settings />} />
      </Routes>
    </Router>
  );
}

export default App;
